func minOperations(s1 string, s2 string, x int) int {
    n := len(s1)
    mismatches := 0
    adjMismatches := 0

    // Step 1: Count mismatches and adjacent mismatches
    for i := 0; i < n; i++ {
        if s1[i] != s2[i] {
            mismatches++
            if i < n-1 && s1[i+1] != s2[i+1] && s1[i] != s1[i+1] {
                adjMismatches++
                i++ // Skip next character as it's part of an adjacent mismatch
            }
        }
    }

    // If there's an odd number of mismatches, return -1
    if mismatches%2 != 0 {
        return -1
    }

    // Step 2: Calculate the minimum cost
    nonAdjMismatches := mismatches/2 - adjMismatches
    cost := min(x, 2) * nonAdjMismatches + adjMismatches

    return cost
}

